import React from 'react';
import '../styles/pages/AdminDashboard.css';

const AdminDashboard = () => {
  const stats = [
    { title: 'Total Users', value: 150 },
    { title: 'Active Jobs', value: 45 },
    { title: 'Completed Jobs', value: 120 },
    { title: 'Pending Approvals', value: 10 },
  ];

  const recentActivities = [
    'User John Doe registered.',
    'Job #123 has been approved.',
    'Payment for Job #121 processed.',
    'User Jane Smith updated profile.',
  ];

  return (
    <div className="admin-dashboard">
      <header className="dashboard-header">
        <h1>Admin Dashboard</h1>
        <p>Welcome back! Manage the platform and monitor its performance here.</p>
      </header>

      <section className="dashboard-stats">
        {stats.map((stat, index) => (
          <div key={index} className="stat-card">
            <h3>{stat.title}</h3>
            <p>{stat.value}</p>
          </div>
        ))}
      </section>

      <section className="dashboard-recent">
        <h2>Recent Activities</h2>
        <ul>
          {recentActivities.map((activity, index) => (
            <li key={index}>{activity}</li>
          ))}
        </ul>
      </section>
    </div>
  );
};

export default AdminDashboard;
